    % helper
    methods(Static, Access = 'public')                 
        
        % fundamental arguments of nutation theory
        function f = F(t)                              
            
            % input:
            %
            %    t [Nx1] - TDB, time in Julian centuries since J2000.0
            %
            %
            % output:
            %
            %    f [Nx14] - lunisolar(5) and planetary(9) args in radians
            %
            %
            %  NOTES:
            %
            %    Ref: IERS Conventions 2010, ch5, pp 67 & 68
            %
            %    Ref: www.iausofa.org/2012_0301_C/FundArgs.html
            %
            
            % define polynomial coeffs [arcsec]
            
            % Mean Anomaly of the Moon 
            F1  = [    
                        485868.249036      ; ...
                    1717915923.2178        ; ... 
                            31.8792        ; ...
                             0.051635      ; ...
                           - 0.00024470      ...
            ];
             
            % Mean Anomaly of the Sun
            F2 = [
                       1287104.793048      ; ...
                     129596581.0481        ; ...
                           - 0.5532        ; ...
                             0.000136      ; ...
                           - 0.00001149      ...
            ];
              
            % Mean longitude of the Moon minus that of the ascending node
            F3 = [
                        335779.526232      ; ...
                    1739527262.8478        ; ...
                          - 12.7512        ; ...
                          -  0.001037      ; ...
                             0.00000417      ...
            ]; 
             
            % Mean elongation of the Moon from the Sun
            F4 = [
                       1072260.703692      ; ...
                    1602961601.2090        ; ...
                           - 6.3706        ; ...
                             0.006593      ; ...
                           - 0.00003169      ...
            ];
        
            % Mean longitude of the ascending node of the Moon
            F5 = [
                        450160.398036      ; ...
                     - 6962890.5431        ; ...
                             7.4722        ; ...
                             0.007702      ; ...
                           - 0.00005939      ...
            ];
        
            % Mean longitude of Mercury (L_Me/Fame)
            F6 = [                           
                             4.402608842   ; ...
                          2608.7903141574  ; ...
                             0.0           ; ...
                             0.0           ; ...
                             0.0             ...
            ];
        
            % Mean longitude of Venus (L_Ve/Fave)
            F7 = [                           
                             3.176146697   ; ...
                          1021.3285546211  ; ...
                             0.0           ; ...
                             0.0           ; ...
                             0.0             ...
            ];
        
            % Mean longitude of Earth (L_E/Fae)
            F8 = [                           
                             1.753470314   ; ...
                           628.3075849991  ; ...
                             0.0           ; ...
                             0.0           ; ...
                             0.0             ...
            ];
        
            % Mean longitude of Mars (M_Ma/Fama)
            F9 = [                           
                             6.203480913   ; ...
                           334.0612426700  ; ...
                             0.0           ; ...
                             0.0           ; ...
                             0.0             ...
            ];
        
            % Mean longitude of Jupiter (L_J/Faju)
            F10 = [                          
                             0.599546497   ; ...
                            52.9690962641  ; ...
                             0.0           ; ...
                             0.0           ; ...
                             0.0             ...
            ];
        
            % Mean longitude of Saturn (L_Sa/Fasa)
            F11 = [                          
                             0.874016757   ; ...
                            21.3299104960  ; ...
                             0.0           ; ...
                             0.0           ; ...
                             0.0             ...
            ];
        
            % Mean longitude of Uranus (L_U/Faur)
            F12 = [                          
                             5.481293872   ; ...
                             7.4781598567  ; ...
                             0.0           ; ...
                             0.0           ; ...
                             0.0             ...
            ];
        
            % Mean longitude of Neptune (L_Ne/Fane)
            F13 = [                          
                             5.311886287   ; ...
                             3.8133035638  ; ...
                             0.0           ; ...
                             0.0           ; ...
                             0.0             ...
            ];
        
            % General accumulated precession in longitued (pA/Fapa)
            F14 = [                        
                             0.0           ; ...
                             0.024381750   ; ...
                             0.00000538691 ; ...
                             0.0           ; ...
                             0.0             ...
            ];
            
        
            % make sure t is a column vector
            t = t(:);
            
            % form basis vectors 
            tt = [ t.^0  t.^1  t.^2  t.^3  t.^4 ];
            
            % compute the lunisolar terms
            lunisolar = [tt*F1, tt*F2, tt*F3, tt*F4, tt*F5];
            
            % tidy up (convert to arcseconds then to radians)
            lunisolar = rem(lunisolar,IERSLib.TURNAS).*IERSLib.AS2R;
            
            % compute the planetary terms
            planetary = [
                         tt*F6 , tt*F7 , tt*F8 , tt*F9 ,  ...
                         tt*F10, tt*F11, tt*F12, tt*F13,  ...
            ];
        
            % tidy up, normalize between 0 and 2*pi
            planetary = rem(planetary,2*pi);
            
            % make sure any negative radians get "flipped"
            planetary(planetary<0) = planetary(planetary<0)+2*pi;
            
            % that's all folks (f in radians)
            f = [lunisolar planetary tt*F14];
            
        end
       
        % non-polynomial series summation
        function seriesSum = seriesImpl(t,F,A,N,c,s)   
            
            % input, M = {1600,1275,66}:
            %
            %   t [ Nx1 ] - in julian centeries referenced to TT
            %
            %   F [ Nx14] - fundamental args of nutation
            %
            %   A [ Mx14] - expressions of fund. args of nutation
            %
            %   N [  5  ] - where poisson terms between for each t^i
            %
            %   c [ Mx1 ] - series Fourier & Poisson cos() coeffs
            %
            %   s [ Mx1 ] - series Fourier & Poisson sin() coeffs
            %
            %
            
            % compute powers of t for Poisson terms [Nx{1600,1275,66}]
            T = [                              ...
                    t(:,ones(1,N(1))).^0 ...
                    t(:,ones(1,N(2))).^1 ...
                    t(:,ones(1,N(3))).^2 ...
                    t(:,ones(1,N(4))).^3 ...
                    t(:,ones(1,N(5))).^4 ...
            ];
        
            % compute the argument [Nx{1600,1275,66}]
            ARG = (A*F')';
            
            % the sum of the series at each time [Nx1]
            seriesSum = (sin(ARG).*T)*s + (cos(ARG).*T)*c;
            
        end
        
        % earth rotation angle
        function theta   = ERA(fMJD_UTC,du)            
            
            %
            % [E]arth [R]otation [A]ngle
            %
            %
            %  input:
            %
            %    t     [Nx1] - fMJD times (referenced to UTC)
            %
            %    du    [Nx1] - UTC-UT1 offset
            %
            %
            %  output:
            %
            %    theta [Nx1] - era at time specified by t [radians]
            %
            %
            %  NOTE: 
            %
            %    MJD reference epoch: 2400000.5
            %
            %    The direction is CIRS -> TIRS
            %
            
            % compute whole julian day reference to utc
            JD_UTC = floor(fMJD_UTC) + IERSLib.MJD_REF_EPOCH;
            
            % compute fractional part of day referenced to ut1
            tut    = (fMJD_UTC - floor(fMJD_UTC)) + du./86400;

            % compute time in julian centeries
            t = tut + (JD_UTC - IERSLib.DJ00);

            % Fractional part of T (days).
            f = rem(tut, 1.0) + rem(JD_UTC,1.0);

            % Earth rotation angle at this UT1
            theta = 2 * pi *(f + 0.7790572732640 + 0.00273781191135448 * t);

            % normalize between zero and 2 * pi
            theta = rem(theta,2*pi);  theta(theta<0) = theta(theta<0)+2*pi;
            
        end
        
        % TIO locator [radians]      
        function sp = SP00(t)                          
            
            % input:
            %
            %  t   [Nx1] - fMJD referenced to terrestrial time TT
            %
            % output:
            %
            %   sp [Nx1] - TIO locator (s-prime) in [radians]
            %
            %
            
            % interval between fundamental epoch 
            % J2000.0 and current date (JC)
            t = ( ( IERSLib.MJD_REF_EPOCH - IERSLib.DJ00) + t) / IERSLib.DJC;

            % compute
            sp = -47e-6 * t * IERSLib.AS2R;
        end
        
        % rotation matricies 
        function r1 = R1(angle)                        
            
            % angle in radians
            r1 = [  
                    1       0            0     ;
                    0   cos(angle)  sin(angle) ;
                    0  -sin(angle)  cos(angle) ;
                 ];
        end
         
        % rotation about the second axis 
        function r2 = R2(angle)                        
            
            % angle in radians
            r2 = [
                    cos(angle)   0   -sin(angle) ;
                       0         1        0      ;
                    sin(angle)   0    cos(angle) ;
            ];
            
        end
        
        % rotation about the 3rd axis 
        function r3 = R3(angle)                        
            
            % angle in radians
            r3 = [
                    cos(angle)   sin(angle)  0 ;
                   -sin(angle)   cos(angle)  0 ;
                        0           0        1 ;
            ];
            
        end
       
        % C2IXYs
        function C = C2I(X,Y,s)                        
            
            %
            % C = celestial-to-intermediate matrix
            %
        
            % init spherical angle e
            e = 0;
            
            % compute square sum
            r = X.^2 + Y.^2;
            
            % Obtain the spherical angles E 
            if r ~= 0; e = atan2(Y,X); end
            
            % and d
            d = atan( sqrt( r / (1 - r) ) );

            % do it!
            C = IERSLib.R3(-(e+s))*IERSLib.R2(d)*IERSLib.R3(e);
        end
        
        % polar motion matrix
        function P = POM00(xp,yp,sp)                   
            
            %
            %  input:
            %
            %      xp,yp  [1]  coordinates of the pole [radians]
            %
            %         sp  [1]  the TIO locator s'      [radians]
            %
            %
            %  output:
            %
            %          P [3x3] Polar motion matrix from TIRS -> ITRS
            %
            %
            %  NOTE:  the direction is from TIRS -> ITRS
            %
            
            P = IERSLib.R1(-yp) * IERSLib.R2(-xp) * IERSLib.R3(sp); 
        end

    end
     
    methods(Access = 'public')                         
        
        function this    = IERSLib()                   
            this.Px = this.Px_IERS_2010;
            this.Py = this.Py_IERS_2010;
            this.Ps = this.Ps_IERS_2010;
        end
        
        function [X,Y,s] = XYs(this,t)                 
            
            % make sure t is a column vector 
            t = t(:);
            
            % adjust time 
            dt = IERSLib.MJD_REF_EPOCH - IERSLib.DJ00;
            
            % compute the time in julian centeries
            t = ( dt + t ) ./ IERSLib.DJC;
            
            % compute basis vectors
            tt = [ t.^0   t.^1   t.^2   t.^3   t.^4   t.^5 ];
            
            % compute the fundamental args of nutation at each time t
            F = IERSLib.F(t);
            
            
            % compute X  [microarcseconds]
            X = tt * this.Px ...
                    + IERSLib.seriesImpl(t,F,this.Ax,this.Nx,this.Cx,this.Sx);
            
            
            % compute Y  [microarcseconds]
            Y = tt * this.Py ...
                    + IERSLib.seriesImpl(t,F,this.Ay,this.Ny,this.Cy,this.Sy);
     
            
            % compute s  [microarcseconds]
            s = tt * this.Ps ...
                    + IERSLib.seriesImpl(t,F,this.As,this.Ns,this.Cs,this.Ss);
                
            
            % convert to arcseconds 
            X = X./1e6;  Y = Y./1e6;  s = s./1e6;
            
            
            % convert to radians
            X = X.*IERSLib.AS2R;  Y = Y.*IERSLib.AS2R;  s = s.*IERSLib.AS2R;
            
            
            % tidy up s
            s = s - (X.*Y)./2;
            
        end
         
        function [dX,dY] = dXdY(this,t)                
            
            %
            %  Free Core Nutation corrections for CIP
            %
            %    The quantities dX and dY should be added to X and Y
            %
            %
            %  input:
            %
            %     t   [Nx1] - fractional MJD referenced to TBD (TT is ok)
            %
            %
            %  output:
            %
            %     dX  [Nx1] - CIO X coordinate correction [radians]
            %
            %     dY  [Nx1] - CIO Y coordinate correction [radians]
            %
            %
            %  NOTES:
            %
            %     - translation of FCNNUT.F as provided by IERS 
            %
            
            % compute the reference epoch (MJD of J2000) 
            t_ref = IERSLib.DJ00 - IERSLib.MJD_REF_EPOCH;
            
            % period in days
            P  = -430.21;
            
            % compute the angular frequency
            phi = (2*pi/P) .* (t - t_ref);
            
            % compute coeffs at the apprpriate times of t
            Xc = interp1(this.FCN(:,1), this.FCN(:,2), t, 'linear','extrap');
            Xs = interp1(this.FCN(:,1), this.FCN(:,3), t, 'linear','extrap');
            
            % now compute the corrections (NOTE: Ys = -Xc, Yc = Xs)
            
            % IERS 2010 - ch5 eqn 5.28
            %dX =   Xs .* sin( phi ) +  Xc .* cos( phi );
            %dY =  -Xc .* sin( phi ) +  Xs .* cos( phi ); 

            % FCNNUT.F (wtf?)
            dX =   Xc .* cos( phi ) -  Xs .* sin( phi );
            dY =   Xs .* cos( phi ) - -Xc .* sin( phi ); 
            
            % convert to arc seconds
            dX = dX./1e6;  dY = dY./1e6;
            
            % convert to radians
            dX = dX.*IERSLib.AS2R;  dY = dY.*IERSLib.AS2R;

        end
        
        function GC2IT = GCRS2ITRS(this,t,dt,du,xp,yp) 
            
            % 
            % input:
            %
            %    t       - modified julian day referenced to UTC
            %
            %    dt      - UTC-TAI offset (leapsecs)    [seconds]
            %
            %    dut     - UT1-UTC offset               [seconds]
            %
            %    xp,yp   - coordinates of the pole      [arcsec ]
            %
            %
            % output:
            %
            %    GC2IT   - 3x3 transformation matrix from 
            %              Geocentric Reference System to
            %              Iternational Terestrial Reference System
            %
            
            % fractional mjd referenced to terestrial time
            t_TT  = t + (dt + IERSLib.TT_OFFSET)/86400;
            
            % first convert xp and yp to radians
            xp = xp.*IERSLib.AS2R;  yp = yp.*IERSLib.AS2R;
            
            % compute the TIO locator at time t
            sp = IERSLib.SP00(t_TT);
            
            % comput the polar motion matrix
            P = IERSLib.POM00(xp,yp,sp);
            
            % compute the earth rotation angle
            theta_ERA = IERSLib.ERA(t,du);
            
            % compute the unit vectors to CIO
            [X,Y,s] = this.XYs(t_TT);
            
            % compute the CIO xformation matrix
            C = IERSLib.C2I(X,Y,s);
            
            % put it all together ...
            GC2IT = P * IERSLib.R3(theta_ERA) * C;
            
        end
        
        function bool    = test(this)                  
           
            bool =                          ... 
                      this.test_F_1     ()  ...
                    & this.test_F_2     ()  ...
                    & this.test_XYs_1   ()  ...
                    & this.test_XYs_2   ()  ...
                    & this.test_XYs_3   ()  ...
                    & this.test_ERA_1   ()  ...
                    & this.test_ERA_2   ()  ...
                    & this.test_SP00_1  ()  ...
                    & this.test_SP00_2  ()  ...
                    & this.test_C2I_1   ()  ...
                    & this.test_POM00_1 ()  ...
                    & this.test_POM00_2 ()  ...
                    & this.test_GC2IT_1 ()  ...
                    & this.test_dXdY_1  ()  ...
            ;            
        end
    end
    
